import React from 'react';
import { StatusBar } from 'expo-status-bar';
import LoginScreen from './LoginScreen';

export default function App() {
  return (
    <>
      <StatusBar style="dark" backgroundColor="#E9EEEE" />
      <LoginScreen />
    </>
  );
}
